import React from "react";
import NavBar from "./NavBar";
import styled from "styled-components";

const Fixed = styled.div`
  position: fixed;
  top: 0;
  width: 100%;
`;

export default function HeaderComp() {
  return (
    <Fixed>
      <NavBar />
    </Fixed>
  );
}
